According to the <a href="http://www.songfacts.com/detail.php?id=21600" rel="nofollow">Who You Are Songfacts</a>, Cornish wrote this self-help ballad at the end of a lonely three-month trip to Los Angeles when she was 20. Having been shunted from studio to studio with various producers she was ready to pack it all in. She told The Independent December 10, 2010: &quot;I'm very much someone that lives to be happy. It's not just about the parties and I know so-and-so – I'm not that girl. So I looked in the mirror and started to cry and said 'who am I?' Music is my therapy.&quot;

 &quot;Who You Are&quot; was released first as a promotional single and peaked at #86 on the Australian Singles Chart, #40 on UK Singles Chart and #85 on the Canadian Hot 100. In November, &quot;Who You Are&quot; was released as the fifth single from her debut album in the UK. It peaked at #8 on the UK Singles Chart making it Jessie J's fourth top-ten single in the United Kingdom. The single has been silver certified by the BPI.

